import React from 'react';

const CountryList = ({ countries }) => {
    return (
        <div>
            <h2>Country List</h2>
            <ul>
                {countries.map((country, index) => (
                    <li key={index}>{country}</li>
                ))}
            </ul>
        </div>
    );
};

export default CountryList;
